import "./MainCompStyles.css"
import { useState, useEffect } from "react";

function MainFrame() {

    const handleSubmit = (e) => {

        e.preventDefault();

        var user_in = e.target[0].value

        if (user_in !== ""){

            const [data, setData] = [{}]

            useEffect( () => {

                fetch("/input").then(

                    res => res.json()

                ).then(

                    data => {

                        setData(data)
                        console.log(data)
                    }
                )

            }, [])
        }

    }

    return(

        <div className="MainFrame">

            <form onSubmit={handleSubmit}>
                <label>Hello there?</label>
                <input type="text" name="user_input" className="user_in"/>
                <input type="submit" name="user_input" className="user_in"/>
            </form>

        </div>
    )


}

export default MainFrame
